}

const jumbo = {
	minHeight:"20vh",
	padding:"0",
	backgroudSize:"cover",
	backgroundImage :'url(img/jumbotron_background.jpg)'
}

const img = {
}

const Jumbo = (props) => {
	return (
		<div>
		<Jumbotron fluid style={jumbo} >
		<Image style={img} fluid/>

				<h3 style={h3}>점보트론</h3>

		</Jumbotron>
		</div>
	);
};

